class book extends Component{

        render(){
            return(
                <Card>
                <CardMedia
                        className={styles.image}
                        image={tempImage}
                        title="本の画像"></CardMedia>
                    <CardContent>
                        <Typography variant="h5">本のタイトル</Typography>
                        <Typography variant="body">備考</Typography>
                    </CardContent>
                </Card>
              
        )}
    }
    export default book;
